const offline = false

export function AuthCheck() {
    return useQuery("auth", async () => {
        if (offline) {
            return offlineAuth
        }
        const { data } = await axios.post(
            "/api/auth.php",
            {
                "ReturnTo":window.location.href
            }
        )
        return data
    }, {
        retry: false
    })
}

